import React from 'react';

class Header extends React.Component {



    render () {
        const navMenuStyle = {
            color: "red",
            marginLeft: "auto"
        };



        var Logo = () => {
            return (
                <a><img src="imgs/18-years.png"></img></a>
            );
        }

        return (
            <div className="header-outer">
                <div className="container">
                    <div className="row">
                        <div className="col"><Logo/></div>
                        <div className="col" style={navMenuStyle}>Test 67</div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Header;
